window.addEventListener("load",()=>{let sbm=document.querySelectorAll(".submenu-wrapper");for(i=0;i<sbm.length;i+=1){sbm[i].remove()}let subMenu=document.querySelector(".sub-menu-items");for(i=0;i<sbm.length;i+=1){subMenu.appendChild(sbm[i])}let child=document.getElementsByClassName("child");for(i=0;i<child.length;i+=1){if(child[i].classList.contains("opened"))sbm[i].classList.add("opened")}});